INSERT INTO `berita` (`id`, `id_admin`, `judul`, `isi`, `foto`, `created_at`, `updated_at`) VALUES
(1, 10, 'mkasd', 'Banyak Pilihan Produk Terbaik\r\nAda banyak pilihan maskapai dengan rute terlengkap ke seluruh dunia. Tersedia juga banyak pilihan hotel di Asia. Kamu juga bisa cari tiket kereta ke berbagai rute, sewa mobil, dan pesan tiket hiburan.', 'app/images/Berita/-1640170563-hGK3T.jpg', '2021-12-22 03:56:03', '2021-12-22 03:56:03'),
(4, 10, 'Peripura VS Arema di Sini Bro, Kuy lah nonton uk', 'Dengan penghitungan kata atau karakter, Anda dapat dengan mudah dan cepat mengetahui jumlah kata dan huruf dalam teks. Hal ini dapat berguna ketika Anda perlu untuk menulis teks yang akan memiliki batas karakter, atau saat menulis teks dengan jumlah kata atau karakter tertentu.\r\n\r\nSebuah counter kata-kata dan karakter menargetkan berbagai pengguna: dari siswa untuk SEO profesional, wartawan atau penulis, manajer komunitas, peneliti ... profil ini mungkin perlu kalkulator untuk menghitung jumlah paragraf, kalimat, kata-kata atau huruf dalam penulisan mereka, tesis, pesan, artikel atau teks.', 'app/images/Berita/-1640172460-kHuAO.jpg', '2021-12-22 04:27:40', '2021-12-22 08:01:04'),
(6, 10, 'Shin Tae-yong Kecewa Indonesia Vs Singapura Selesai Seri', 'Jakarta - Timnas Indonesia bermain imbang dengan Timnas Singapura pada leg I semifinal Piala AFF 2020. Pelatih Skuad Garuda, Shin Tae-yong, mengaku kecewa dengan hasil akhirnya.\r\nDalam pertandingan di National Stadium, Singapura, Rabu (22/12/2021), Indonesia vs Singapura selesai 1-1. Tim Merah Putih unggul lebih dulu di babak pertama.\r\n\r\nAksi solo run Asnawi Mangkualam di sisi kanan, diselesaikan oleh Witan Sulaeman untuk membawa Indonesia menutup paruh pertama laga dengan skor 1-0.\r\n\r\nBaca artikel sepakbola, \"Shin Tae-yong Kecewa Indonesia Vs Singapura Selesai Seri\" selengkapnya https://sport.detik.com/sepakbola/liga-indonesia/d-5866657/shin-tae-yong-kecewa-indonesia-vs-singapura-selesai-seri.\r\n\r\nDownload Apps Detikcom Sekarang https://apps.detik.com/detik/', 'app/images/Berita/-1640187749-uqD97.jpg', '2021-12-22 08:42:29', '2021-12-22 08:42:29'),
(7, 10, 'ndonesia Negara Paling Dermawan di Dunia Sepanjang 2021', 'Indonesia Negara Paling Dermawan di Dunia Sepanjang 2021 Kompas.com - 22/12/2021, 07:00 WIB BAGIKAN: Komentar11 Lihat Foto Ilustrasi donasi.(Unsplash.com/Katt Yukawa) Penulis Aprillia Ika | Editor Aprillia Ika KOMPAS.com - Di tengah pandemi, Indonesia kembali dinobatkan sebagai negara paling dermawan di dunia menurut Charities Aid Foundation (CAF) World Giving Index 2021. Hal ini selaras dengan data donasi online yang dirilis oleh Kitabisa, platform galang dana dan donasi online, bahwa sepanjang 2021 tercatat lebih dari 3 juta donatur berdonasi via aplikasi Kitabisa, yang membantu lebih dari 36.000 galang dana sosial. Baca juga: Kolaborasi ShopeePay dan Kitabisa Bantu UKM Bernapas di Masa Pandemi Hasil donasi ini didistribusikan ke berbagai inisiatif, di antaranya lebih dari 840.000 warga mendapatkan bantuan kebutuhan pokok, lebih dari 9.100 warga yang sakit terbantu biaya pengobatannya, serta lebih dari 3.400 pelajar dan mahasiswa mendapatkan bantuan biaya pendidikan. Tak hanya itu, merespons berbagai bencana alam di tahun ini, ratusan ribu orang baik patungan untuk bantu ribuan korban. \"Banyak peristiwa yang terjadi di luar kontrol kita, termasuk Pandemi Covid yang tidak berkesudahan ini, tapi yang pasti kita bisa kontrol bagaimana kita merespon peristiwa tersebut, dan kami jadi saksi kita bersama-sama merespons dengan solidaritas dan gotong royong‚Äù, ujar Alfatih Timur, CEO Kitabisa, melalui rilis ke Kompas.com, Selasa (21/12/2021).  Baca juga: Kunci KitaBisa Bertahan di Tengah Pandemi Dapatkan informasi, inspirasi dan insight di email kamu. Daftarkan email Kitabisa juga mencatat setidaknya ada lebih dari 1.200 inisiatif untuk menolong anjing, kucing, serta hewan lainnya yang terbantu selama 2021. Ada pun penyaluran dana zakat yang diterima melalui Kitabisa dan berkolaborasi dengan puluhan LAZ (lembaga amil zakat) telah membantu setidaknya 155.000 mustahik (golongan penerima zakat). Baca juga: Kitabisa Mendadak Trending, Ini Sejarah Urun Dana ala Crowdfunding Gerakan sosial berbasis gotong-royong Berbagai gerakan sosial berbasis gotong-royong warga juga bermunculan sepanjang 2021, yang tercatat di Kitabisa.  Misalnya, inisiatif Warga Bantu Warga (pengumpulan informasi penting terkait Covid-19), Oxygen for Indonesia (distribusi ribuan konsentrator oksigen melalui kolaborasi puluhan perusahaan), hingga Kawal Masa Depan (patungan bantuan untuk anak yatim piatu karena Covid-19). Beberapa tokoh publik dan aktivis lain seperti Najwa Shihab, Ainun Najib, Kalis Mardiasih, dan Faiz Ghifari menginisiasi Kawal Masa Depan, gerakan membantu anak-anak yang yatim atau piatu karena pandemi covid-19. Gerakan ini telah didukung 48 ribu donatur dan telah menyalurkan santunan dan bantuan biaya pendidikan ke lebih dari 600 anak yatim / piatu di 22 provinsi di Indonesia. Dapatkan update berita pilihan dan breaking news setiap hari dari Kompas.com. Mari bergabung di Grup Telegram \"Kompas.com News Update\", caranya klik link https://t.me/kompascomupdate, kemudian join. Anda harus install aplikasi Telegram terlebih dulu di ponsel. Lihat Money Selengkapnya LIHAT SEMUA Twibbon - Suara Perempuan Arisan Parapuan eps. 10 Gopay Total Rp 4 Juta Hanya untuk Kamu Survei Video KG Media Kompas Travel Games Bantu kami jadi lebih baik lagi! TTS - Teka - teki Santuy Ep 59 Seputar Perangkat Komputer TTS - Teka - Teki Santuy Ep 60 Edisi Hari Penting Di Indonesia TTS - Teka - Teki Santuy Ep 58 Edisi Nama - Nama Negara\r\n\r\nArtikel ini telah tayang di Kompas.com dengan judul \"Indonesia Negara Paling Dermawan di Dunia Sepanjang 2021\", Klik untuk baca: https://money.kompas.com/read/2021/12/22/070000726/indonesia-negara-paling-dermawan-di-dunia-sepanjang-2021.\r\nPenulis : Aprillia Ika\r\nEditor : Aprillia Ika\r\n\r\nDownload aplikasi Kompas.com untuk akses berita lebih mudah dan cepat:\r\nAndroid: https://bit.ly/3g85pkA\r\niOS: https://apple.co/3hXWJ0L', 'app/images/Berita/-1640188058-6WJoU.jpg', '2021-12-22 08:47:38', '2021-12-22 08:47:38'),
(9, 13, 'Malam saat hujan, lampu merah simpang agusdjam sangat bahaya bagi para pengendara', 'Pada malam hari adalah waktu dimana jalan sepi, banyak pengendara merasa bahwa lampu merah simpang agusdjam tidak ada pengendara lain, hal ini mengakibatkan terjadinya tabrakan\r\n\r\nHal seperti ini tidak bisa dipungkiri lagi', 'app/images/Berita/-1641639920-oh51e.jpg', '2022-01-08 04:05:20', '2022-01-08 04:05:20');

